import { createSlice } from "@reduxjs/toolkit";

const cartSlice = createSlice({
  name: "cart",
  initialState: {
    items: [],
    totalQunatity: 0,
  },
  reducers: {
    addItem(state, actions) {
      console.log("haii");
    },
    removeItem(state, action) {},
  },
});

export const carstActions = cartSlice.actions;
export default cartSlice;
